import logo from './logo.svg';
import './App.css';
import { Component } from 'react';

class Element extends Component { 
  constructor(props) {
    super(props);
  }
  componentDidUpdate() { 
    if (this.props.needUpdate == true) { 
      var current_element = document.getElementById(this.props.id)
      if (this.props.condition == "default") { 
        current_element.style.background = ''
      }
    }
  }
  render() { 
    return <button className="square" id = {this.props.id}> {this.props.id} </button>
  }
}

function App() {
  return (
    <div className="App">
    </div>
  );
}

export default App;
